// GraphViewerComponent.js (Offline Functionality)
// Copyright (c) Microsoft Corporation.
// Licensed under the MIT license.

import React from "react";
import { Icon } from "office-ui-fabric-react";

import GraphViewerCommandBarComponent from "./GraphViewerCommandBarComponent/GraphViewerCommandBarComponent";
import {
  GraphViewerCytoscapeComponent,
  GraphViewerCytoscapeLayouts
} from "./GraphViewerCytoscapeComponent/GraphViewerCytoscapeComponent";
import { withTranslation } from "react-i18next";

import LoaderComponent from "../LoaderComponent/LoaderComponent";
import {
  REL_TYPE_OUTGOING,
  DETAIL_MIN_WIDTH,
  PROPERTY_INSPECTOR_DEFAULT_WIDTH
} from "../../services/Constants";

import "./GraphViewerComponent.scss";

class GraphViewerComponent extends React.Component {

  constructor(props) {
    super(props);
    this.state = {
      progress: 0,
      isLoading: false,
      selectedNode: null,
      selectedNodes: null,
      selectedEdges: null,
      layout: "Klay",
      hideMode: "hide-selected",
      canShowAll: false,
      // eslint-disable-next-line react/no-unused-state
      overlayResults: false,
      // eslint-disable-next-line react/no-unused-state
      overlayItems: {},
      // eslint-disable-next-line react/no-unused-state
      filterIsOpen: false,
      // eslint-disable-next-line react/no-unused-state
      currentFilter: "filter",
      // eslint-disable-next-line react/no-unused-state
      propertyInspectorIsOpen: true,
      // eslint-disable-next-line react/no-unused-state
      canShowAllRelationships: false,
      // eslint-disable-next-line react/no-unused-state
      propInspectorDetailWidth: PROPERTY_INSPECTOR_DEFAULT_WIDTH,
      couldNotDisplay: false,
      // eslint-disable-next-line react/no-unused-state
      outputIsOpen: false,
      // eslint-disable-next-line react/no-unused-state
      highlightingTerms: [],
      // eslint-disable-next-line react/no-unused-state
      filteringTerms: [],
      // eslint-disable-next-line react/no-unused-state
      highlightedNodes: [],
      // eslint-disable-next-line react/no-unused-state
      filteredNodes: [],
      // eslint-disable-next-line react/no-unused-state
      noResults: false,
      // eslint-disable-next-line react/no-unused-state
      isDisplayNameAsteriskPresent: false,
      // eslint-disable-next-line line-comment-position, no-inline-comments
      mockTwins: [], // Mock twin data
      // eslint-disable-next-line line-comment-position, no-inline-comments
      mockRelationships: [] // Mock relationship data
    };
    this.cyRef = React.createRef();
    this.canceled = false;
    this.resizeStartX = 0;
    this.resizeEndX = 0;
    this.allNodes = [];
    this.relationships = [];
  }

  componentDidMount() {
    // Load mock data on component mount
    this.loadMockData();
  }

  loadMockData = () => {
    // Replace this with your mock data
    const mockTwins = [
      { $dtId: "twin1", displayName: "Twin 1" },
      { $dtId: "twin2", displayName: "Twin 2" },
      { $dtId: "twin3", displayName: "Twin 3" }
    ];

    const mockRelationships = [
      {
        $sourceId: "twin1",
        $targetId: "twin2",
        relationshipName: "connectedTo"
      },
      {
        $sourceId: "twin2",
        $targetId: "twin3",
        relationshipName: "connectedTo"
      }
    ];

    this.setState({ mockTwins, mockRelationships }, () => {
      this.renderGraph();
    });
  };

  renderGraph = () => {
    const { mockTwins, mockRelationships } = this.state;

    // Simulate loading process
    this.setState({ isLoading: true, progress: 0 });

    setTimeout(() => {
      if (this.cyRef.current) {
        this.cyRef.current.clearTwins();
        this.cyRef.current.addTwins(mockTwins);
        this.cyRef.current.addRelationships(mockRelationships);
        this.cyRef.current.doLayout();
      }

      this.setState({
        isLoading: false,
        progress: 100,
        couldNotDisplay: mockTwins.length === 0
      });
    // eslint-disable-next-line line-comment-position, no-inline-comments
    }, 1000); // Simulated delay
  };

  onNodeClicked = e => {
    const selectedNode = e.selectedNode;
    // eslint-disable-next-line react/no-unused-state
    this.setState({ selectedNode });
  };

  onEdgeClicked = e => {
    const selectedEdges = e.selectedEdges;
    // eslint-disable-next-line react/no-unused-state
    this.setState({ selectedEdges });
  };

  clearGraph = () => {
    if (this.cyRef.current) {
      this.cyRef.current.clearTwins();
      this.cyRef.current.clearRelationships();
    }
    this.setState({
      // eslint-disable-next-line react/no-unused-state
      selectedNode: null,
      // eslint-disable-next-line react/no-unused-state
      selectedNodes: null,
      // eslint-disable-next-line react/no-unused-state
      selectedEdges: null,
      mockTwins: [],
      mockRelationships: []
    });
  };

  renderCommandBar = () => {
    const { layout, hideMode, canShowAll } = this.state;
    return (
      <GraphViewerCommandBarComponent
        className="gc-commandbar"
        buttonClass="gc-toolbarButtons"
        layouts={Object.keys(GraphViewerCytoscapeLayouts)}
        layout={layout}
        hideMode={hideMode}
        onShowAll={() => this.cyRef.current.showAllNodes()}
        canShowAll={canShowAll}
        onLayoutChanged={newLayout => {
          this.setState({ layout: newLayout });
          this.cyRef.current.setLayout(newLayout);
          this.cyRef.current.doLayout();
        }}
        onClearGraph={this.clearGraph} />
    );
  };

  render() {
    const {
      isLoading,
      progress,
      couldNotDisplay,
      mockTwins,
      mockRelationships
    } = this.state;

    return (
      <div className="gvc-wrap">
        <div className="gc-grid">
          <div className="gc-toolbar">{this.renderCommandBar()}</div>
          <div className="gc-wrap">
            <GraphViewerCytoscapeComponent
              ref={this.cyRef}
              onNodeClicked={this.onNodeClicked}
              onEdgeClicked={this.onEdgeClicked} />
            {couldNotDisplay && (
              <div className="alert-no-display">
                <div className="alert--info">i</div>
                <div className="alert--message">
                  No data available to display.
                </div>
              </div>
            )}
          </div>
        </div>
        {isLoading && <LoaderComponent message={`${Math.round(progress)}%`} />}
        <div className="mock-data-summary">
          <p>Mock Twins: {mockTwins.length}</p>
          <p>Mock Relationships: {mockRelationships.length}</p>
        </div>
      </div>
    );
  }

}

export default withTranslation("translation", { withRef: true })(
  GraphViewerComponent
);
